import { Float } from '../native/Float.js';
/**
 * @name f32
 * @description
 * A 32-bit float
 */
export class f32 extends Float.with(32) {
    constructor() {
        super(...arguments);
        // NOTE without this, we cannot properly determine extensions
        this.__FloatType = 'f32';
    }
}
